import react, { useState, useEffect } from 'react';
import { getAllCharacters } from '../services/getAllCharacters';

export default function List() {
  const [characters, setCharacters] = useState();

  useEffect(() => {
    getAllCharacters()
      .then((data) => {
        setCharacters(data);
      })
      .catch((err) => {
        console.error(err);
      });
  }, []);

  return (
    <>
      <p>{characters.image}</p>
      {characters
        ? characters.map((char) => {
            <p>{char.image}</p>;
          })
        : null}
    </>
  );
}
